import React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { Image } from 'react-native';
import Inicio from '../screens/Home/Inicio';
import Entrar from '../screens/Home/Entrar';
import TabBarIcon from '../components/TabBar/TabIcon'; // Este componente renderiza os ícones personalizados da TabBar

const Tab = createBottomTabNavigator();

export default function NavegacaoTab() {
  return (
    <Tab.Navigator
      screenOptions={{
        headerShown: false,
        tabBarShowLabel: false,
        tabBarActiveTintColor: '#FBED51',
        tabBarInactiveTintColor: '#fff',
        tabBarStyle: {
          backgroundColor: '#2579E7',
          borderTopWidth: 1,
          borderTopColor: '#2579E7',
          height: 65,
        },
      }}
    >
      <Tab.Screen
        name="Inicio"
        component={Inicio}
        options={{
          tabBarIcon: ({ color, focused }) => (
            <TabBarIcon
              icon={require('../../assets/icons/home.png')} // Corrigido o caminho da imagem
              color={color}
              focused={focused}
            />
          ),
        }}
      />
      <Tab.Screen
        name="Entrar"
        component={Entrar}
        options={{
          tabBarIcon: ({ color, focused }) => (
            <TabBarIcon
              icon={require('../../assets/icons/key.png')} // Corrigido o caminho da imagem
              color={color}
              focused={focused}
            />
          ),
        }}
      />
      {/* Adicionar mais abas aqui conforme necessário */}
    </Tab.Navigator>
  );
}
